import React from 'react'
import '../components/Home/home.css'

const Home = prop => {
    console.log(prop.scanInstructions);
    return (
        <div className='homepage-contaniner'>
            <div className='name'>
                <h1>Hello Name</h1>
            </div>
            <div className="scan-instructions">
                <ul className='scan-instructions-list'>{
                    prop.scanInstructions.map((instruction) => {
                        return <li>{instruction.id}, {instruction.text}</li>;
                    })
                }</ul>
            </div>
        </div>
    )
}

export default Home
